import React, { Component } from "react";
import "./styles.scss";

class join extends Component {
  render() {
    return (
      <div className="container-fluid p-0" id="join-login">
        <div className="container join-content">
          <h1>JOIN GIGABYTE AORUS MEMBERSHIP</h1>
          <p>
            When you sign up for GIGABYTE AORUS membership, you'll instantly
            receive 10 bonus points that you can use to redeem rewards from your
            reward boutique. Get started and sign up now.
          </p>
        </div>
      </div>
    );
  }
}

export default join;
